<div id="pf1" class="pf w0 h0" data-page-no="1"><div class="pc pc1 w0 h0"><div class="c x0 y0 w1 h0"><div class="t m0 x1 h1 y1 ff1 fs0 fc0 sc0 ls0 ws0">Публичная оферта о закл<span class="_ _0"></span>ючении </div><div class="t m0 x1 h1 y2 ff1 fs0 fc0 sc0 ls0 ws0">Пользовательского со<span class="_ _0"></span>глашения на </div><div class="t m0 x1 h1 y3 ff1 fs0 fc0 sc0 ls0 ws0">использование Сервиса «<span class="_ _0"></span><span class="ff2">INTERH<span class="_ _0"></span>ELPER» </span></div><div class="t m0 x1 h2 y4 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h3 y5 ff1 fs2 fc0 sc0 ls0 ws0">1. ОБЩИЕ ПОЛ<span class="_ _1"></span>ОЖЕНИЯ<span class="ff2"> </span></div><div class="t m0 x1 h2 y6 ff2 fs1 fc0 sc0 ls0 ws0">1.1. INTERFIRE L<span class="_ _1"></span>LC. <span class="ff1">(далее —</span> INTERHE<span class="_ _1"></span>LPER<span class="ff1">) пред<span class="_ _1"></span>лагает физ<span class="_ _1"></span>ическому лиц<span class="_ _1"></span>у <span class="ff2">- </span>пользователю се<span class="_ _1"></span>ти –<span class="ff2"> </span></span></div><div class="t m0 x1 h2 y7 ff1 fs1 fc0 sc0 ls0 ws0">заключить польз<span class="_ _1"></span>овательс<span class="_ _1"></span>кое соглашени<span class="_ _1"></span>е на использовани<span class="_ _1"></span>е Сервиса «<span class="ff2">INTER<span class="_ _1"></span>HELPER<span class="ff1">.RU» (далее<span class="_ _1"></span> —<span class="ff2"> </span></span></span></div><div class="t m0 x1 h2 y8 ff1 fs1 fc0 sc0 ls0 ws0">«Соглашение», «ПС<span class="_ _1"></span>») (htt<span class="_ _1"></span>ps://<span class="ff2">interhelper</span>.ru) на <span class="_ _1"></span>условиях, изл<span class="_ _1"></span>оженных в нас<span class="_ _1"></span>тоящей пу<span class="_ _1"></span>бличной </div><div class="t m0 x1 h2 y9 ff1 fs1 fc0 sc0 ls0 ws0">оферте (далее –<span class="ff2"> </span>Пу<span class="_ _1"></span>бличная оферта). <span class="_ _1"></span>Соглашение<span class="_ _1"></span> вступ